INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (16, "ヒヨリ", "人助けが大好き！　前向き格闘娘", 0, "獣人族", "人助け、応援", 44, 2, "東山奈央", 27, "トゥインクルウィッシュ", 100101, "A", 155, 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "ユイ", "戦闘のサポートが得意な、心優しい少女", 0, "ヒューマン", "料理、人間観察", 47, 2, "種田梨沙", 5, "トゥインクルウィッシュ", 100201, "O", 158, 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (18, "レイ", "クールで何事にも真っ直ぐな剣士", 0, "魔族", "読書、乗馬、お茶", 46, 2, "早見沙織", 12, "トゥインクルウィッシュ", 100301, "B", 163, 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (9, "ミソギ", "探検好きのイタズラっ子", 0, "ヒューマン", "いたずら、探検", 27, 5, "諸星すみれ", 10, "リトルリリカル", 100401, "O", 128, 8, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "マツリ", "ヒーローに憧れる騎士見習いの少女", 0, "獣人族", "ヒーローごっこ", 40, 8, "下田麻美", 25, "王宮騎士団（NIGHTMARE）", 100501, "O", 146, 11, "？？？");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (13, "アカリ", "甘え上手なみんなの人気者", 0, "魔族", "サックス", 42, 7, "浅倉杏美", 22, "悪魔偽王国軍（ディアボロス）", 100601, "O", 150, 11, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "ミヤコ", "プリン大好きゴースト娘", 0, "魔族", "プリンを食べること", 32, 7, "雨宮天", 23, "悪魔偽王国軍（ディアボロス）", 100701, "B", 130, 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "ユキ", "ボクは誰よりも美しい", 0, "エルフ", "鏡で自分を見ること", 40, 15, "大空直美", 10, "ヴァイスフリューゲル　ランドソル支部", 100801, "AB", 150, 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "アンナ", "前世を信じる中二病患者、「疾風の冥姫」", 0, "魔族", "小説執筆", 45, 13, "髙野麻美", 5, "トワイライトキャラバン", 100901, "A", 159, 7, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (16, "マホ", "マホマホ王国のプリンセス", 0, "獣人族", "空想、ぬいぐるみ集め", 42, 10, "内田真礼", 22, "自警団（カォン）", 101001, "O", 155, 9, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (15, "リノ", "人懐っこくてマシンガントークな妹系少女", 0, "ヒューマン", "お裁縫", 44, 3, "阿澄佳奈", 25, "ラビリンス", 101101, "A", 156, 8, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "ハツネ", "みんなのために超能力を使う眠り姫", 0, "エルフ", "妹と遊ぶこと、二度寝、昼寝、早寝", 46, 6, "大橋彩香", 24, "フォレスティエ", 101201, "A", 156, 12, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (18, "ナナカ", "オタク全開な魔法少女", 0, "魔族", "読書、魔法", 55, 13, "佳村はるか", 21, "トワイライトキャラバン", 101301, "O", 166, 8, "");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (15, "カスミ", "頭脳明晰な美少女名探偵", 0, "獣人族", "読書、推理", 41, 10, "水瀬いのり", 3, "自警団（カォン）", 101401, "AB", 152, 11, "test");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (21, "ミサト", "母性溢れる優しいみんなの「ミサト先生」", 0, "エルフ", "絵本作り", 54, 6, "國府田マリ子", 5, "フォレスティエ", 101501, "O", 165, 9, "test");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "スズナ", "天真爛漫で人気者のカリスマモデル", 0, "魔族", "ファッション", 48, 14, "上坂すみれ", 10, "ルーセント学院", 101601, "O", 167, 4, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "カオリ", "いつでも「なんくるないさ～」な天然娘", 0, "獣人族", "踊り、空手", 53, 10, "高森奈津美", 7, "自警団（カォン）", 101701, "A", 158, 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (23, "イオ", "多くの男性を魅了する無垢な女教師", 0, "魔族", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 52, 14, "伊藤静", 14, "ルーセント学院", 101801, "B", 162, 8, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (10, "ミミ", "お歌もにんじんも、ウサギさんも大好き♪", 0, "獣人族", "かわいいもの集め", 21, 5, "日高里菜", 3, "リトルリリカル", 102001, "O", 117, 4, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "クルミ", "泣き虫で臆病な守ってあげたい女の子", 0, "ヒューマン", "観劇、おままごと", 40, 9, "植田佳奈", 9, "サレンディア救護院", 102101, "B", 150, 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (13, "ヨリ", "人見知りであまのじゃくな女の子", 0, "魔族", "ゲーム全般", 40, 7, "原紗友里", 22, "悪魔偽王国軍（ディアボロス）", 102201, "O", 150, 11, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "アヤネ", "ぷうきちといつも一緒！", 0, "ヒューマン", "屋内でできる遊び", 38, 9, "芹澤優", 10, "サレンディア救護院", 102301, "B", 148, 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (15, "スズメ", "お嬢さまのためにがんばるドジっ娘メイド", 0, "ヒューマン", "ご奉仕", 43, 9, "悠木碧", 12, "サレンディア救護院", 102501, "O", 154, 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "リン", "遊びと睡眠が何より大事なぐうたら娘", 0, "獣人族", "あんパン", 42, 11, "小岩井ことり", 1, "牧場（エリザベスパーク）", 102601, "B", 144, 1, "test");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (16, "エリコ", "運命の相手に一途すぎる乙女", 0, "魔族", "実験、裁縫、料理", 43, 13, "橋本ちなみ", 30, "トワイライトキャラバン", 102701, "B", 154, 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "サレン", "救護院を経営する優しい庶民派お嬢様", 0, "エルフ", "経営、お茶会", 43, 9, "堀江由衣", 4, "サレンディア救護院", 102801, "A", 156, 10, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "ノゾミ", "歌って踊れる大人気アイドル", 0, "ヒューマン", "舞台鑑賞、ダンス", 40, 4, "日笠陽子", 24, "カルミナ", 102901, "B", 157, 1, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (16, "ニノン", "トーゴクの神秘、オシエテクダサイ！", 0, "ヒューマン", "忍法開発", 51, 15, "佐藤聡美", 31, "ヴァイスフリューゲル　ランドソル支部", 103001, "O", 163, 8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (18, "シノブ", "占いが得意な霊能少女", 0, "魔族", "占い", 42, 7, "大坪由佳", 22, "悪魔偽王国軍（ディアボロス）", 103101, "AB", 157, 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (18, "アキノ", "一人前の商人を目指すパワフルお嬢様", 0, "ヒューマン", "慈善事業", 45, 12, "松嵜麗", 12, "メルクリウス財団", 103201, "AB", 157, 3, "この私とともにいる限り、\nお金に不自由はさせませんわ！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (20, "マヒル", "みんなを笑顔にするお笑い牧場主", 0, "ヒューマン", "漫才", 35, 11, "新田恵海", 3, "牧場（エリザベスパーク）", 103301, "B", 142, 3, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (22, "ユカリ", "純情でほっとけない大人の女性", 0, "エルフ", "ウインドーショッピング", 55, 12, "今井麻美", 16, "メルクリウス財団", 103401, "A", 164, 3, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (8, "キョウカ", "礼儀正しくしっかり者のちびっ子優等生", 0, "エルフ", "お勉強", 21, 5, "小倉唯", 2, "リトルリリカル", 103601, "A", 118, 2, "test");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (13, "トモ", "義理堅くてからかい好きな剣術少女", 0, "ヒューマン", "剣術、年長者をからかう", 43, 8, "茅原実里", 11, "王宮騎士団（NIGHTMARE）", 103701, "A", 149, 8, "test");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "シオリ", "読書が趣味の病弱少女", 0, "獣人族", "読書、お散歩", 40, 11, "小清水亜美", 3, "牧場（エリザベスパーク）", 103801, "A", 153, 11, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (13, "アオイ", "「友達」に憧れる、エルフの森の女の子", 0, "エルフ", "友達作りのイメトレ", 44, 6, "花澤香菜", 6, "フォレスティエ", 104001, "AB", 158, 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "チカ", "人々を守るために歌う、唱喚士の少女", 0, "ヒューマン", "各種楽器", 46, 4, "福原綾香", 3, "カルミナ", 104201, "O", 163, 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "マコト", "男勝りで情に厚いワイルド娘", 0, "獣人族", "お菓子作り", 54, 10, "小松未可子", 9, "自警団（カォン）", 104301, "O", 168, 8, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES ("??", "イリヤ", "かつては夜を支配した最強の吸血鬼", 0, "魔族", "世界征服", 50, 7, "丹下桜", 5, "悪魔偽王国軍（ディアボロス）", 104401, "A", 172, 5, "test");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (18, "クウカ", "妄想大好き！　ほんとは照れ屋な女の子", 0, "ヒューマン", "小説を読むこと", 49, 15, "長妻樹里", 19, "ヴァイスフリューゲル　ランドソル支部", 104501, "AB", 157, 11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (19, "タマキ", "弱きを助け強きをくじく猫娘", 0, "獣人族", "猫とたわむれること", 48, 12, "沼倉愛美", 1, "メルクリウス財団", 104601, "AB", 158, 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (25, "ジュン", "素顔を見せない冷静沈着な女性騎士", 0, "ヒューマン", "格闘技、湯浴み", 50, 8, "川澄綾子", 25, "王宮騎士団（NIGHTMARE）", 104701, "A", 171, 10, "？？？");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (20, "ミフユ", "仕事も私事も効率優先な傭兵少女", 0, "ヒューマン", "傭兵などのアルバイト", 49, 12, "田所あずさ", 11, "メルクリウス財団", 104801, "O", 163, 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (18, "シズル", "お姉ちゃんがお世話してあげるからねっ！", 0, "ヒューマン", "家事全般", 54, 3, "生天目仁美", 24, "ラビリンス", 104901, "O", 168, 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (11, "ミサキ", "ちょっとおませな恋に恋する女の子", 0, "魔族", "ファッション誌鑑賞、コスメ集め", 22, 14, "久野美咲", 3, "ルーセント学院", 105001, "A", 120, 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (27, "ミツキ", "実験が趣味の危険な科学者", 0, "ヒューマン", "研究、実験", 53, 13, "三石琴乃", 7, "トワイライトキャラバン", 105101, "A", 166, 3, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "リマ", "乙女チックなもふもふアニマル", 0, "獣人族", "毛繕い、お喋り", 100, 11, "徳井青空", 14, "牧場（エリザベスパーク）", 105201, "A", 150, 3, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "モニカ", "見た目も中身もお子ちゃまな異国の軍人", 0, "ヒューマン", "お菓子屋通い", 33, 15, "辻あゆみ", 28, "ヴァイスフリューゲル　ランドソル支部", 105301, "A", 140, 7, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "ツムギ", "ファッション大好きなキュートガール", 0, "ヒューマン", "裁縫", 45, 4, "木戸衣吹", 7, "カルミナ", 105401, "AB", 153, 9, "test");
