INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (25, "ルカ", "人情味溢れる粋でいなせな「姉御」", 0, "ヒューマン", "釣り", 54, 13, "佐藤利奈", 11, "トワイライトキャラバン", 105601, "B", 167, 7, "test");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "ジータ", "空への冒険を夢見る騎空士の少女", 0, "ヒューマン", "冒険、おしゃべり", 45, "", "金元寿子", 10, "？？？", 105701, "O", 156, 3, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "ペコリーヌ", "いつも元気な腹ペコ少女", 0, "ヒューマン", "食べ歩き、料理", 46, 1, "M・A・O", 31, "美食殿", 105801, "O", 156, 3, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (11, "コッコロ", "主を慕う、小さなガイド役", 0, "エルフ", "瞑想、動植物の飼育", 35, 1, "伊藤美来", 11, "美食殿", 105901, "B", 140, 5, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "キャル", "行き倒れの謎のネコミミ魔法使い", 0, "獣人族", "猫と遊ぶ", 39, 1, "立花理香", 2, "美食殿", 106001, "A", 152, 9, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (16, "ムイミ", "さまよえる謎の少女", 0, "ヒューマン", "冒険、思い出話", 40, "", "潘めぐみ", 11, "？？？", 106101, "O", 148, 8, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ");
