INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (15, "スズメ（サマー）", "お嬢さまのためにがんばるドジっ娘メイド", 0, "ヒューマン", "ご奉仕", 43, 9, "悠木碧", 12, "サレンディア救護院", 107701, "O", 154, 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "キャル（サマー）", "行き倒れの謎のネコミミ魔法使い", 0, "獣人族", "猫と遊ぶ", 39, 1, "立花理香", 2, "美食殿", 107801, "A", 152, 9, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (19, "タマキ（サマー）", "弱きを助け強きをくじく猫娘", 0, "獣人族", "猫とたわむれること", 48, 12, "沼倉愛美", 1, "メルクリウス財団", 107901, "AB", 158, 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (20, "ミフユ（サマー）", "仕事も私事も効率優先な傭兵少女", 0, "ヒューマン", "傭兵などのアルバイト", 49, 12, "田所あずさ", 11, "メルクリウス財団", 108001, "O", 163, 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (18, "シノブ（ハロウィン）", "占いが得意な霊能少女", 0, "魔族", "占い", 42, 7, "大坪由佳", 22, "悪魔偽王国軍（ディアボロス）", 108101, "AB", 157, 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "ミヤコ（ハロウィン）", "プリン大好きゴースト娘", 0, "魔族", "プリンを食べること", 32, 7, "雨宮天", 23, "悪魔偽王国軍（ディアボロス）", 108201, "B", 130, 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (11, "ミサキ（ハロウィン）", "ちょっとおませな恋に恋する女の子", 0, "魔族", "ファッション誌鑑賞、コスメ集め", 22, 14, "久野美咲", 3, "ルーセント学院", 108301, "A", 120, 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "チカ（クリスマス）", "人々を守るために歌う、唱喚士の少女", 0, "ヒューマン", "各種楽器", 46, 4, "福原綾香", 3, "カルミナ", 108401, "O", 163, 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "クルミ（クリスマス）", "泣き虫で臆病な守ってあげたい女の子", 0, "ヒューマン", "観劇、おままごと", 40, 9, "植田佳奈", 9, "サレンディア救護院", 108501, "B", 150, 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "アヤネ（クリスマス）", "ぷうきちといつも一緒！", 0, "ヒューマン", "屋内でできる遊び", 38, 9, "芹澤優", 10, "サレンディア救護院", 108601, "B", 148, 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (16, "ヒヨリ（ニューイヤー）", "人助けが大好き！　前向き格闘娘", 0, "獣人族", "人助け、応援", 44, 2, "東山奈央", 27, "トゥインクルウィッシュ", 108701, "A", 155, 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "ユイ（ニューイヤー）", "戦闘のサポートが得意な、心優しい少女", 0, "ヒューマン", "料理、人間観察", 47, 2, "種田梨沙", 5, "トゥインクルウィッシュ", 108801, "O", 158, 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (18, "レイ（ニューイヤー）", "クールで何事にも真っ直ぐな剣士", 0, "魔族", "読書、乗馬、お茶", 46, 2, "早見沙織", 12, "トゥインクルウィッシュ", 108901, "B", 163, 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (16, "エリコ（バレンタイン）", "運命の相手に一途すぎる乙女", 0, "魔族", "実験、裁縫、料理", 43, 13, "橋本ちなみ", 30, "トワイライトキャラバン", 109001, "B", 154, 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (18, "シズル（バレンタイン）", "お姉ちゃんがお世話してあげるからねっ！", 0, "ヒューマン", "家事全般", 54, 3, "生天目仁美", 24, "ラビリンス", 109101, "O", 168, 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "アン", "英霊と契約を結んだマナリアの天才王女", 0, "ヒューマン", "読書", 55, "", "日笠陽子", 1, "？？？", 109201, "AB", 156, 12, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (16, "ルゥ", "マナリア魔法学院の新入生", 0, "ヒューマン", "食べること、眠ること", 45, "", "こやまきみこ", 4, "？？？", 109301, "O", 144, 2, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "グレア", "人を超越した力を有す心優しい竜姫", 0, "半人半竜", "ピアノ", 67, "", "福原綾香", 3, "？？？", 109401, "B", 167, 11, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (18, "クウカ（オーエド）", "妄想大好き！　ほんとは照れ屋な女の子", 0, "ヒューマン", "小説を読むこと", 49, 15, "長妻樹里", 19, "ヴァイスフリューゲル　ランドソル支部", 109501, "AB", 157, 11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (16, "ニノン（オーエド）", "トーゴクの神秘、オシエテクダサイ！", 0, "ヒューマン", "忍法開発", 51, 15, "佐藤聡美", 31, "ヴァイスフリューゲル　ランドソル支部", 109601, "O", 163, 8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "レム", "鬼がかりの万能妹メイド", 0, "鬼族", "演劇鑑賞、詩文", "??", "", "水瀬いのり", 2, "？？？", 109701, "?", 154, 2, "");
