INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "ユキ（オーエド）", "ボクは誰よりも美しい", 0, "エルフ", "鏡で自分を見ること", 40, 15, "大空直美", 10, "ヴァイスフリューゲル　ランドソル支部", 117601, "AB", 150, 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪");
