INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "アンナ（パイレーツ）", "前世を信じる中二病患者、「疾風の冥姫」", 0, "魔族", "小説執筆", 45, 13, "髙野麻美", 5, "トワイライトキャラバン", 121901, "A", 159, 7, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (18, "シノブ（パイレーツ）", "占いが得意な霊能少女", 0, "魔族", "占い", 42, 7, "大坪由佳", 22, "悪魔偽王国軍（ディアボロス）", 122001, "AB", 157, 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね");
