INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (18, "レイ（サマー）", "クールで何事にも真っ直ぐな剣士", 0, "魔族", "読書、乗馬、お茶", 46, 2, "早見沙織", 12, "トゥインクルウィッシュ", 122501, "B", 163, 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "ユイ（サマー）", "戦闘のサポートが得意な、心優しい少女", 0, "ヒューマン", "料理、人間観察", 47, 2, "種田梨沙", 5, "トゥインクルウィッシュ", 122601, "O", 158, 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！");
