INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (17, "モニカ（カフェ）", "見た目も中身もお子ちゃまな異国の軍人", 0, "ヒューマン", "お菓子屋通い", 33, 15, "辻あゆみ", 28, "ヴァイスフリューゲル　ランドソル支部", 125201, "A", 140, 7, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！");
